import "./styles/styles.css";
import React, { useState } from "react";
import { Location } from "./components/Location";

const APIID = "431416ee6ac11ff008eca9e762cf30d3";
const DEFAULT_CITY = "Calgary"; //later it will be determine from user's location

export default function App() {
  const [city1, setCity1] = useState(DEFAULT_CITY);
  const [city2, setCity2] = useState("Tokyo");
  const [city3, setCity3] = useState("New York");

  return (
    <React.Fragment>
      <Location city={city1} />
      <Location city={city2} />
      <Location city={city3} />
    </React.Fragment>
  );
}
